import bubbleSort from '../sortStrategies/bubbleSort'
import quickSort from '../sortStrategies/quickSort';
export default  [{
    name: 'Bubble Sort',
    performance: 'O(n^2)',
    sortingFunction: bubbleSort
},
{
    name: 'Quick Sort',
    performance: 'O(n log n)',
    sortingFunction: quickSort
}]
